import{_ as a,o as e,c as s,R as n}from"./chunks/framework.zUbWieqp.js";const m=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"guide/Database/pgSql/faq/3-Dbeaver.md","filePath":"guide/Database/pgSql/faq/3-Dbeaver.md","lastUpdated":1711535325000}'),o={name:"guide/Database/pgSql/faq/3-Dbeaver.md"},t=n(`<h2 id="_0-简介" tabindex="-1">0.简介 <a class="header-anchor" href="#_0-简介" aria-label="Permalink to &quot;0.简介&quot;">​</a></h2><p>DBeaver 是一个通用的数据库管理工具和 SQL 客户端，支持 MySQL, PostgreSQL, Oracle, DB2, MSSQL, Sybase, Mimer, HSQLDB, Derby, 以及其他兼容 JDBC 的数据库。DBeaver 提供一个图形界面用来查看数据库结构、执行SQL查询和脚本，浏览和导出数据，处理BLOB/CLOB 数据，修改数据库结构等等。</p><p>DBeaver 分为 <code>Lite</code>、<code>Enterprise</code>、<code>Ultimate</code>、<code>Community</code>，其中<code>Community</code>免费使用，但是功能不言而喻，具体差异自行去官网对比：<a href="https://dbeaver.com/edition/" target="_blank" rel="noreferrer">https://dbeaver.com/edition/</a></p><h2 id="_1-环境配置" tabindex="-1">1.环境配置 <a class="header-anchor" href="#_1-环境配置" aria-label="Permalink to &quot;1.环境配置&quot;">​</a></h2><p>默认不显示所有数据库</p><h3 id="_1-1下载" tabindex="-1">1.1下载 <a class="header-anchor" href="#_1-1下载" aria-label="Permalink to &quot;1.1下载&quot;">​</a></h3><p>DBeaver 各个版本下载地址：<a href="https://dbeaver.com/download/" target="_blank" rel="noreferrer">https://dbeaver.com/download/</a></p><h3 id="_1-2安装" tabindex="-1">1.2安装 <a class="header-anchor" href="#_1-2安装" aria-label="Permalink to &quot;1.2安装&quot;">​</a></h3><h3 id="_1-3激活" tabindex="-1">1.3激活 <a class="header-anchor" href="#_1-3激活" aria-label="Permalink to &quot;1.3激活&quot;">​</a></h3><p>DBeaver 运行需要使用 Java 环境。不要使用 DBeaver 自带的 jre ，它被人为阉割了。使用本激活包需要删除 DBeaver 目录下自带的 <code>jre</code>，自行安装JDK 11</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202403271541728.jpg" alt=""></p><ul><li>配置java路径</li></ul><p>替换 <code>dbeaver.ini</code> 内由 <code>-vm</code> 指定的 <code>jdk 11 的 bin</code> 路径，把地址换成自己安装的！</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">-vm</span></span>
<span class="line"><span style="color:#e1e4e8;">/path/to/your/bin/java</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">-vm</span></span>
<span class="line"><span style="color:#24292e;">/path/to/your/bin/java</span></span></code></pre></div><ul><li>添加激活包配置</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">在 dbeaver.ini 编辑窗口末行添加：-javaagent:/absolute/path/to/dbeaver-agent.jar</span></span>
<span class="line"><span style="color:#e1e4e8;"></span></span>
<span class="line"><span style="color:#e1e4e8;">#如</span></span>
<span class="line"><span style="color:#e1e4e8;">mac:      -javaagent:/Users/dbeaver-agent/dbeaver-agent.jar</span></span>
<span class="line"><span style="color:#e1e4e8;">linux:    -javaagent:/home/dbeaver-agent/dbeaver-agent.jar</span></span>
<span class="line"><span style="color:#e1e4e8;">windows:  -javaagent:C:\\Users\\dbeaver-agent\\dbeaver-agent.jar</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">在 dbeaver.ini 编辑窗口末行添加：-javaagent:/absolute/path/to/dbeaver-agent.jar</span></span>
<span class="line"><span style="color:#24292e;"></span></span>
<span class="line"><span style="color:#24292e;">#如</span></span>
<span class="line"><span style="color:#24292e;">mac:      -javaagent:/Users/dbeaver-agent/dbeaver-agent.jar</span></span>
<span class="line"><span style="color:#24292e;">linux:    -javaagent:/home/dbeaver-agent/dbeaver-agent.jar</span></span>
<span class="line"><span style="color:#24292e;">windows:  -javaagent:C:\\Users\\dbeaver-agent\\dbeaver-agent.jar</span></span></code></pre></div><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202403271541767.jpg" alt=""></p><p>运行 DBeaver ，弹框让你填入 <code>License</code> ，将下面 DBeaver 的专属激活码就行了</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;"></span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;"></span></span></code></pre></div><h2 id="_2-dbeaver中table插入新的数据" tabindex="-1">2.DBeaver中table插入新的数据 <a class="header-anchor" href="#_2-dbeaver中table插入新的数据" aria-label="Permalink to &quot;2.DBeaver中table插入新的数据&quot;">​</a></h2><p>在表格的数据区域<code>alt + insert</code>就可以插入一行数据</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202403271542192.jpg" alt=""></p><p>在数据区域按下 alt + insert 就会出现一行绿色的空白记录</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202403271542758.jpg" alt=""></p><h2 id="_3-修改table的column名字" tabindex="-1">3.修改table的column名字 <a class="header-anchor" href="#_3-修改table的column名字" aria-label="Permalink to &quot;3.修改table的column名字&quot;">​</a></h2><p>直接鼠标选中我们想要修改的column，然后按下F2。然后保存就可以</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202403271542371.jpg" alt=""></p><h2 id="_4-设置表格主键" tabindex="-1">4.设置表格主键 <a class="header-anchor" href="#_4-设置表格主键" aria-label="Permalink to &quot;4.设置表格主键&quot;">​</a></h2><p>设置主键的话，是在约束里面</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202403271542314.jpg" alt=""></p><p>上面这个表的主键 设置为 id 。那么我应该点击约束的新建约束</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202403271542185.jpg" alt=""></p><p>然后会弹出下面这样的选项卡</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202403271542905.jpg" alt=""></p><p>在这里选中你要设置成主键的那个列，然后点击确定，然后保存修改(按ctrl + s或者点击左下角的那个保存按钮</p><p>保存修改的时候就会弹出下面这个执行sql脚本的框</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202403271542099.jpg" alt=""></p><p>id的旁边出现了一个小灯泡的标志</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202403271542165.jpg" alt=""></p>`,39),l=[t];function p(r,c,i,d,h,g){return e(),s("div",null,l)}const b=a(o,[["render",p]]);export{m as __pageData,b as default};
